var calculateAreas = function(classifiedImage,whichmap,title,colors,names){
  var areaImage = ee.Image.pixelArea().divide(1e4).addBands(classifiedImage);
  print(areaImage);
  var areasChart = ui.Chart.image.byClass({
      image: areaImage,
      classBand: 'classification',
      scale: 30,
      region: AOI,
      reducer: ee.Reducer.sum(),
      classLabels: names
    });
  if(whichmap == 'map1'){
      areasChart.setOptions({
        hAxis: {title: 'Classes'},
        vAxis: {title: 'Area (Hectares)'},
        title: title,
        colors: colors
      })
      chartPnl1.clear();
      chartPnl1.add(areasChart);
      // print('------- Chart Generated ---------',areasChart.getDataTable())
    } else if(whichmap == 'map2'){
        areasChart.setOptions({
          hAxis: {title: 'Classes'},
          vAxis: {title: 'Area (Hectares)'},
          title: title,
          colors: colors
        })
        chartPnl2.clear();
        chartPnl2.add(areasChart);
        // print('------- Chart Generated ---------',areasChart1.getDataTable())
    }
}
